const longestDupSubstring = require('./longestDupSubstring')

test('Example 1', () => {
  const S = 'banana'

  const result = longestDupSubstring(S)

  expect(result).toBe('ana')
})

test('Example 2', () => {
  const S = 'abcd'

  const result = longestDupSubstring(S)

  expect(result).toBe('')
})

test('Long string', () => {
  const S = ''

  const result = longestDupSubstring(S)

  expect(result).toBe('akyj')
})
